@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Transaction a owl:Class .
atm:Customer a owl:Class .
atm:TransactionLimit a owl:Class .
atm:TransactionDialog a owl:Class .

atm:hasEnteredAmount a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Transaction .

atm:exceeds a owl:ObjectProperty ;
    rdfs:domain atm:Transaction ;
    rdfs:range atm:TransactionLimit .

atm:isCanceled a owl:ObjectProperty ;
    rdfs:domain atm:Transaction ;
    rdfs:range atm:Transaction .

atm:isRestarted a owl:ObjectProperty ;
    rdfs:domain atm:TransactionDialog ;
    rdfs:range atm:TransactionDialog .

atm:TransactionLimit a owl:Restriction ;
    owl:onProperty atm:exceeds ;
    owl:someValuesFrom atm:Transaction .

atm:Transaction a owl:Restriction ;
    owl:onProperty atm:isCanceled ;
    owl:someValuesFrom atm:Transaction .

atm:TransactionDialog a owl:Restriction ;
    owl:onProperty atm:isRestarted ;
    owl:someValuesFrom atm:TransactionDialog .
